      </div>
      <div className="link-tab">
        <Link to="/Model9">
          <button className="btn">
            <span>P9</span>
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model12">
          <button className="btn">
            <span>P12</span>
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model13">
          <button className="btn">
            <span>P13</span>
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model17">
          <button className="btn btn-17">
            <span>P17</span>
            </button>
          </Link>
      </div>
      </div>
    </div>
  );
};

export default Home;
